(54, 'Những tác dụng của tinh dầu bưởi', '<p>Từ xa xưa con người đ&atilde; biết đến t&aacute;c dụng của tinh dầu bưởi nhờ sử dụng v&agrave; trải nghiệm l&acirc;u d&agrave;i. C&aacute;c nh&agrave; khoa học b&acirc;y giờ cũng đ&atilde; c&ocirc;ng nhận c&ocirc;ng dụng của tinh dầu bưởi đối với con người l&agrave; rất tốt. Trong vỏ bưởi c&oacute; chứa nhiều chất xơ c&oacute; t&aacute;c dụng rất tốt đối với hệ ti&ecirc;u h&oacute;a, l&agrave;n da, gi&uacute;p trẻ h&oacute;a v&agrave; kh&ocirc;ng bị n&aacute;m sạm. Ngo&agrave;i ra tinh dầu bưởi c&ograve;n gi&uacute;p chữa bệnh rụng t&oacute;c, gi&uacute;p t&oacute;c chắc khỏe, mượt m&agrave; tự nhi&ecirc;n.<br />\r\nSau đ&acirc;y t&ocirc;i xin giới thiệu một số c&ocirc;ng dụng của tinh dầu bưởi, c&aacute;ch nấu v&agrave; sử dụng tinh dầu bưởi:</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://buoitanlachoabinh.16mb.com/Buoi/images/tac-dung-cua-tinh-dau-buoi.jpg\" style=\"height:298px; width:400px\" /></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p>I. T&aacute;c dụng của tinh dầu bưởi<br />\r\nTinh dầu bưởi c&oacute; t&aacute;c dụng g&igrave; l&agrave; c&acirc;u hỏi của rất nhiều chị em phụ nữ đưa ra. Sau đ&acirc;y t&ocirc;i xin kể ra 4 t&aacute;c dụng ti&ecirc;u biểu nhất m&agrave; tinh dầu bưởi đạt kết quả cao nhất.<br />\r\n1. Tinh dầu vỏ bưởi gi&uacute;p Dưỡng da s&aacute;ng mịn v&agrave; ngừa l&atilde;o h&oacute;a<br />\r\nTrong tinh dầu bưởi c&oacute; v&ocirc; số h&agrave;m lượng vitamin C tuyệt vời gi&uacute;p tăng cường sức đề kh&aacute;ng cho cơ thể bạn, gi&uacute;p chống sự oxy h&oacute;a, bảo vệ cơ thể khỏi c&aacute;c t&aacute;c hại từ m&ocirc;i trường b&ecirc;n ngo&agrave;i v&agrave; &aacute;nh nắng mặt trời. Ngo&agrave;i ra, tinh dầu vỏ bưởi c&ograve;n c&oacute; t&aacute;c dụng trẻ h&oacute;a da v&ocirc; c&ugrave;ng hiệu quả.<br />\r\nC&aacute;ch sử dụng tinh dầu bưởi: Mỗi tuần 1 lần, bạn n&ecirc;n sử dụng m&aacute;y x&ocirc;ng hơi hoặc nhỏ v&agrave;i giọt tinh dầu bưởi v&agrave;o b&aacute;t nước ấm sau đ&oacute; ch&ugrave;m khăn k&iacute;n đầu v&agrave; x&ocirc;ng da mặt trong khoảng 15 &ndash; 20 ph&uacute;t l&agrave;m như vậy đều đặn sẽ gi&uacute;p tinh dầu bưởi thẩm thấu v&agrave;o da gi&uacute;p da trắng s&aacute;ng mịn m&agrave; v&agrave; căng hồng tự nhi&ecirc;n.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://buoitanlachoabinh.16mb.com/Buoi/images/tac-dung-giam-can-tu-vo-buoi-4.jpg\" style=\"height:299px; width:448px\" /></p>\r\n\r\n<p>2. Tinh dầu bưởi c&oacute; t&aacute;c dụng giảm c&acirc;n hiệu quả<br />\r\nĐể giảm b&eacute;o nhiều người chọn phương ph&aacute;p tập thể dục, tập gym, yoga&hellip; Nhưng đối với những người bận rộn th&igrave; việc sử dụng từ &frac12; &ndash; 1 tr&aacute;i bưởi mỗi ng&agrave;y sau bữa ăn cũng sẽ c&oacute; hiệu quả giảm c&acirc;n v&ocirc; c&ugrave;ng tốt. Do trong bưởi c&oacute; chứa một số enzyme c&oacute; t&aacute;c dụng cao trong việc đốt ch&aacute;y c&aacute;c chất b&eacute;o. Nhiều nghi&ecirc;n cứu cho thấy những enzyme c&oacute; trong bưởi c&ograve;n g&oacute;p phần thay đổi nồng độ insulin, c&oacute; ảnh hưởng rất lớn đến việc trao đổi chất, l&agrave;m hạn chế việc t&iacute;ch mỡ trong cơ thể. Khuyến c&aacute;o: c&aacute;ch l&agrave;m n&agrave;y tuyệt đối kh&ocirc;ng &aacute;p dụng với những ai c&oacute; tiền sử về bệnh đau dạ d&agrave;y. Ngo&agrave;i ra để giảm b&eacute;o, bạn c&oacute; thể d&ugrave;ng tinh dầu bưởi massage h&agrave;ng ng&agrave;y sẽ l&agrave;m giảm mỡ bụng v&agrave; c&aacute;c phần mỡ dư thừa kh&aacute;c v&ocirc; c&ugrave;ng hiệu quả. C&aacute;c hoạt chất tinh dầu c&oacute; trong vỏ bưởi c&oacute; t&aacute;c dụng l&agrave;m giảm mỡ trong m&aacute;u sau 1 &ndash; 2 th&aacute;ng ki&ecirc;n tr&igrave; &aacute;p dụng.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://buoitanlachoabinh.16mb.com/Buoi/images/tac-dung-giam-can-tu-vo-buoi-1.jpg\" style=\"height:283px; width:423px\" /></p>\r\n\r\n<p>3. C&ocirc;ng dụng tinh dầu bưởi trị mụn trứng c&aacute;<br />\r\nVới h&agrave;m lượng vitamin A v&agrave; C c&oacute; nhiều trong vỏ bưởi v&igrave; vậy tinh dầu vỏ bưởi được xem l&agrave; sản phẩm l&yacute; tưởng trong việc chăm s&oacute;c v&agrave; điều trị da bị mụn.<br />\r\nC&aacute;ch sử dụng tinh dầu bưởi trị mụn như sau: Pha v&agrave;i giọt tinh dầu bưởi với 1 th&igrave;a dầu nền (dầu olive, dầu dừa&hellip;) sau đ&oacute; thoa đều l&ecirc;n da mặt v&agrave; massage trong khoảng 15 ph&uacute;t. C&ocirc;ng dụng của tinh dầu bưởi sẽ l&agrave;m cho những nốt mụn xẹp xuống v&agrave; điều tiết lượng dầu nhờn tr&ecirc;n da cực kỳ hiệu quả.</p>\r\n\r\n<p>4. Tinh dầu vỏ bưởi gi&uacute;p mọc t&oacute;c<br />\r\nMột trong những c&ocirc;ng dụng của tinh dầu bưởi được nhiều người biết đến nhất l&agrave; khả năng l&agrave;m mượt v&agrave; &oacute;ng t&oacute;c, gi&uacute;p duy tr&igrave; độ d&agrave;i, l&agrave;m giảm t&oacute;c g&atilde;y rụng, giảm xơ g&atilde;y, phục hồi t&oacute;c bị hư tổn, k&iacute;ch th&iacute;ch mọc t&oacute;c, đặc trị chứng h&oacute;i đầu, gi&uacute;p t&oacute;c chắc khỏe v&agrave; b&oacute;ng mượt. Tinh dầu bưởi sử dụng được với tất cả mọi người, đặc biệt th&iacute;ch hợp với chị em phụ nữ sau sinh.<br />\r\nC&aacute;ch sử dụng tinh dầu bưởi : Để c&oacute; m&aacute;i t&oacute;c &oacute;ng mượt, bạn h&ograve;a 5 &ndash; 7 giọt tinh dầu v&agrave;o 10ml nước, sau đ&oacute; massage đều l&ecirc;n da đầu, để cho t&oacute;c kh&ocirc; tự nhi&ecirc;n, kh&ocirc;ng cần gội lại bằng nước sạch. Bạn cần &aacute;p dụng thường xuy&ecirc;n từ 2 &ndash; 3 lần/ tuần sẽ cho kết quả tốt nhất.</p>\r\n\r\n<p>II. C&aacute;ch nấu tinh dầu bưởi<br />\r\nTinh dầu bưởi ch&uacute;ng ta c&oacute; thể mua ở ngo&agrave;i thị trường nhưng để d&ugrave;ng tinh dầu thi&ecirc;n nhi&ecirc;n th&igrave; ch&uacute;ng ta c&oacute; thể tự triết xuất tại nh&agrave;. Như vậy sẽ đảm bảo vừa nguy&ecirc;n chất v&agrave; vừa an to&agrave;n khi m&igrave;nh sử dụng. Tự chế tinh dầu bưởi kh&ocirc;ng hề kh&oacute; v&agrave; c&oacute; rất nhiều c&aacute;ch rất l&agrave; đơn giản v&agrave; c&oacute; thể tự l&agrave;m.<br />\r\nTừ kh&oacute;a li&ecirc;n quan: c&aacute;ch lấy tinh dầu từ vỏ bưởi, cach nau tinh dau buoi, c&aacute;ch sử dụng tinh dầu vỏ bưởi<br />\r\nC&aacute;ch 1: C&aacute;ch lấy tinh dầu vỏ bưởi<br />\r\nChuẩn bị:<br />\r\n&ndash; 1 tr&aacute;i bưởi<br />\r\n&ndash; 1 lọ thủy tinh c&oacute; lắp đậy<br />\r\n&ndash; 1 ly nước lọc<br />\r\nThực hiện c&aacute;ch lấy tinh dầu bưởi:<br />\r\n&ndash; Ch&uacute;ng ta lấy dao cắt 1 lớp vỏ mỏng ở b&ecirc;n ngo&agrave;i quả bưởi, v&igrave; lượng tinh dầu của bưởi nằm ở ph&iacute;a vỏ quả bưởi<br />\r\n&ndash; Sau đ&oacute; ta d&ugrave;ng tay vắt tinh dầu bưởi v&agrave;o c&aacute;i lọ thủy tinh rồi đổ nước lọc v&agrave;o lọ với tỷ l&ecirc; 1 : 100 v&agrave; sau đ&oacute; lắc kỹ l&ecirc;n.<br />\r\nC&aacute;ch 2: C&aacute;ch nấu tinh dầu bưởi gội đầu<br />\r\nChuẩn bị:<br />\r\n&ndash; 1 c&aacute;i bếp v&agrave; 1 c&aacute;i nồi nhỏ<br />\r\n&ndash; 1 &iacute;t nước v&agrave; vỏ bưởi phơi kh&ocirc;<br />\r\nThực hiện nấu tinh dầu bưởi gội đầu<br />\r\n&ndash; cho vỏ bưởi v&agrave;o nồi v&agrave; đổ nước cho ngập vỏ bưởi.<br />\r\n&ndash; Nấu vỏ bưởi trong khoảng 15 đến 20p<br />\r\n&ndash; Sau đ&oacute; để nguội v&agrave; lấy nước vỏ bưởi để gội đầu</p>\r\n', 10, 1, 1, 1, '2017-05-19 15:27:17', '2017-05-19 16:53:18', 'admin', '2017-05-19 10:06:39', 2),
(57, 'Kỹ thuật trồng bưởi đỏ cho sai quả', '<p>Bưởi Đỏ l&agrave; loại c&acirc;y ăn quả c&oacute; gi&aacute; trị kinh tế cao. Một ha trồng bưởi Đỏ sau 5 năm tuổi c&oacute; thể đạt năng suất từ 45-60 ngh&igrave;n quả/năm, gi&aacute; trị kinh tế từ 600 &ndash; 800 triệu đồng. Tuy nhi&ecirc;n để đạt được năng suất &ndash; chất lượng quả cao, ổn định, b&agrave; con cần &aacute;p dụng đ&uacute;ng kỹ thuật trồng c&acirc;y bưởi Đỏ v&agrave; biện ph&aacute;p chăm s&oacute;c khoa học, dinh dưỡng đầy đủ hợp l&yacute;.</p>\r\n\r\n<h2>Ti&ecirc;u chuẩn chọn C&acirc;y bưởi Đỏ Giống khi đem trồng</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Để c&oacute; những sản phẩm bưởi Đỏ chất lượng cao đ&aacute;p ứng được c&aacute;c y&ecirc;u cầu của thị trường trong nước v&agrave; phục vụ xuất khẩu, B&agrave; con cần ch&uacute; &yacute; tới xuất xứ v&agrave; chất lượng giống. N&ecirc;n Chọn mua c&acirc;y bưởi đỏ giống tại đất đỏ để đảm bảo chất lượng c&acirc;y giống. &ndash; Đối với c&acirc;y bưởi đỏ giống gh&eacute;p bạn n&ecirc;n chọn c&acirc;y bưởi c&oacute; Đường k&iacute;nh gốc gh&eacute;p từ 0,8 &ndash; 1cm, c&agrave;nh cao khoảng 25 &ndash; 30cm, l&aacute; tươi xanh, khỏe mạnh kh&ocirc;ng c&oacute; s&acirc;u bệnh.<br />\r\n&ndash; Đối với c&acirc;y bưởi đỏ chiết:n&ecirc;n chọn c&acirc;y c&oacute; đường k&iacute;nh từ 1 &ndash; 1,5cm, cao khoảng 60 &ndash; 80cm, c&oacute; 2 đến 3 c&agrave;nh cấp 1 được ươm trong bầu, c&oacute; rễ thứ cấp mới được đem đi trồng.<br />\r\nThời gian tốt nhất để trồng c&acirc;y bưởi đỏ:<br />\r\n&ndash; Bưởi đỏ c&oacute; thể trồng v&agrave;o hai m&ugrave;a trong năm đ&oacute; l&agrave; v&agrave;o m&ugrave;a xu&acirc;n từ th&aacute;ng 2 đến th&aacute;ng 4 hoặc v&agrave;o th&aacute;ng 8 đến th&aacute;ng 10 thu đ&ocirc;ng.</p>\r\n\r\n<p><img alt=\"\" src=\"http://buoitanlachoabinh.16mb.com/Buoi/images/anh6.jpg\" style=\"height:498px; width:665px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ch&uacute; &yacute;: Nếu bạn muốn mua c&acirc;y bưởi đỏ giống tr&ecirc;n đất đỏ c&oacute; thể li&ecirc;n hệ qua số điện thoại: <span style=\"color:red; font-size:25px\">0164492648 gặp Mr Linh. Địa chỉ: T&acirc;n Lai- Đ&ocirc;ng Lai- T&acirc;n Lạc - H&ograve;a B&igrave;nh</span><br />\r\nMật độ khoảng c&aacute;ch giữa c&aacute;c c&acirc;y bưởi đỏ: T&ugrave;y v&agrave;o điều kiện thời tiết từng v&ugrave;ng, tuỳ theo đất xấu hay tốt m&agrave; bố tr&iacute; mật độ kh&aacute;c nhau.<br />\r\n&ndash; Đất tốt: Điều kiện th&acirc;m canh cao c&oacute; thể trồng d&agrave;y hơn. Khoảng c&aacute;ch giữa c&aacute;c c&acirc;y 3 x 3,5 m, mật độ khoảng 35 c&acirc;y/s&agrave;o Bắc Bộ.<br />\r\n&ndash; Đất xấu: Khoảng c&aacute;ch giữa c&aacute;c c&acirc;y trung b&igrave;nh 5 m x 6m, mật độ 14 c&acirc;y/s&agrave;o Bắc Bộ.<br />\r\nĐất trồng bưởi đỏ:<br />\r\n&ndash; Đất trồng Bưởi đỏ c&oacute; tầng dầy từ 1m trở l&ecirc;n, kết cấu xốp để giữ m&ugrave;n, giữ m&agrave;u v&agrave; c&aacute;c chất dinh dưỡng, tho&aacute;t nước tốt. Độ PH từ 5,5 đến 6,5 l&agrave; th&iacute;ch hợp nhất. Kh&ocirc;ng n&ecirc;n trồng ở nơi đất trống nhiều gi&oacute;, c&acirc;y sẽ bị ảnh hưởng l&agrave;m hoa dễ rụng tỷ lệ đậu quả thấp, đối với c&aacute;c vườn trồng ri&ecirc;ng lẻ ngo&agrave;i c&aacute;nh đồng trống n&ecirc;n trồng xen c&aacute;c loại c&acirc;y cản gi&oacute;. C&aacute;ch trồng bưởi đỏ:<br />\r\nL&agrave;m đất: cầy bừa kĩ, l&agrave;m sạch cỏ, l&ecirc;n luống c&aacute;ch nhau 5m, r&atilde;nh rộng 30cm, s&acirc;u 30cm, t&acirc;m luống cao từ 30 đến 40 cm so với đ&aacute;y r&atilde;nh.<br />\r\n&ndash; Đ&agrave;o hố nơi đất tốt: k&iacute;ch thước hố 60x60x50cm<br />\r\n&ndash; Đ&agrave;o hố nơi đất xấu: k&iacute;ch thước hố 80x80x60cm<br />\r\n&ndash; Nơi ch&acirc;n đất thấp th&igrave; phải đắp ụ cao từ 50 đến 60 cm, đường k&iacute;nh rộng 1m<br />\r\nPh&acirc;n b&oacute;n l&oacute;t: &ndash; Đất tốt: d&ugrave;ng 20 &ndash; 25kg ph&acirc;n chuồng hoai mục + 0,25 &ndash; 0,3kg l&acirc;n + 0,5kg v&ocirc;i bột rắc xuống hố lấp hố để từ 5 đến 10 ng&agrave;y trước khi trồng c&acirc;y v&agrave;o hố.<br />\r\n&ndash; Đất xấu: d&ugrave;ng 20 &ndash; 30kg ph&acirc;n chuồng hoai mục + 0,3 &ndash; 0,5kg l&acirc;n + 1kg v&ocirc;i bột rắc xuống hố lấp hố để từ 5 đến 10 ng&agrave;y trước khi trồng c&acirc;y v&agrave;o hố..<br />\r\nCh&uacute; &yacute;: Để hỗn hợp ph&acirc;n b&oacute;n l&oacute;t từ 5 &ndash; 10 ng&agrave;y để cho ph&acirc;n chuồng bay hơi hết tr&aacute;nh n&oacute;ng l&agrave;m trột dễ bưởi.<br />\r\n&ndash; D&ugrave;ng cuốc moi đất giữa hố lớn hơn bầu c&acirc;y, cắt d&acirc;y buộc bầu (với c&acirc;y chiết) hoặc b&oacute;c vỏ bầu (đối với c&acirc;y gh&eacute;p), đặt c&acirc;y thẳng đứng, mặt bầu cao bằng mặt ụ, lấp đất n&eacute;n chặt xung quanh t&aacute;n c&acirc;y,ch&uacute; &yacute; kh&ocirc;ng n&eacute;n ở phần gốc c&acirc;y tr&aacute;nh l&agrave;m vỡ bầu đất, đứt rễ, sau đ&oacute; cắm 3 cọc ch&eacute;o buộc d&acirc;y giữ c&acirc;y đứng thẳng gi&uacute;p cho c&acirc;y kh&ocirc;ng bị gi&oacute; thổi đổ hoặc con vật n&agrave;o đi qua kh&ocirc;ng bị si&ecirc;u vẹo. Sau đ&oacute; d&ugrave;ng m&ugrave;n r&aacute;c, cỏ kh&ocirc; phủ k&iacute;n gốc nhằm giữ ẩm cho đất .<br />\r\n&ndash; Sau khi trồng c&acirc;y xong tưới 1 lần thật đẫm. Sau đ&oacute; th&igrave; ng&agrave;y tưới 2 lần s&aacute;ng v&agrave; chiều m&aacute;t với lượng nước vừa đủ, tr&aacute;nh tưới c&acirc;y v&agrave;o buổi trưa nắng v&igrave; như vậy sẽ khiến nước bốc hơi l&agrave;m n&oacute;ng rễ v&agrave; thui trột rễ, những ng&agrave;y sau th&igrave; t&ugrave;y v&agrave;o thời tiết để tưới nước giữ ẩm bộ rễ v&agrave; l&aacute; ph&aacute;t triển.<br />\r\n&ndash; Quan s&aacute;t t&igrave;nh h&igrave;nh ph&aacute;t triển của c&acirc;y để c&oacute; biện ph&aacute;p chữa trị nếu như c&acirc;y c&oacute; bị s&acirc;u bệnh</p>\r\n\r\n<pre>\r\nB&oacute;n ph&acirc;n thời k&igrave; kiến thiết cơ bản ( 1-3 năm tuổi)\r\n\r\nLượng ph&acirc;n b&oacute;n cho c&acirc;y/ năm\r\n\r\n&ndash; Năm thứ 1:\r\n\r\n+ Ph&acirc;n hữu cơ: 30kg\r\n\r\n+ Đạm ur&ecirc;: 300 gam\r\n\r\n+ L&acirc;n supe: 500gam\r\n\r\n+ Kaliclorua: 110gam\r\n\r\n+ V&ocirc;i bột:1kg\r\n\r\n&ndash; Năm thứ 2:\r\n\r\n+ Ph&acirc;n hữu cơ: 30kg\r\n\r\n+ Đạm ur&ecirc;: 500 gam\r\n\r\n+ L&acirc;n supe: 800gam\r\n\r\n+ Kaliclorua: 330gam\r\n\r\n+ V&ocirc;i bột:1kg\r\n\r\n&ndash; Năm thứ 3:\r\n\r\n+ Ph&acirc;n hữu cơ: 50kg\r\n\r\n+ Đạm ur&ecirc;: 860 gam\r\n\r\n+ L&acirc;n supe: 1200gam\r\n\r\n+ Kaliclorua: 460gam\r\n\r\n+ V&ocirc;i bột:1kg\r\n\r\nThời gian b&aacute;n ph&acirc;n v&agrave;o c&aacute;c đợt:\r\n\r\n+ Đợt b&oacute;n th&aacute;ng 2: B&oacute;n 100% ph&acirc;n hữu cơ + 40% đạm ure + 40% kaliclorua\r\n\r\n+ Đợt b&oacute;n th&aacute;ng 5: 30% đạm + 30% kaliclorua\r\n\r\n+ Đợt b&oacute;n th&aacute;ng 8: 30% đạm + 30% kaliclorua\r\n\r\n+  Đợt b&oacute;n th&aacute;ng 11: 100% l&acirc;n supe + 100% v&ocirc;i\r\n\r\nCh&uacute; &yacute;: Khi b&oacute;n ph&acirc;n kết hợp l&agrave;m sạch cỏ.\r\n\r\nB&oacute;n ph&acirc;n khi bưởi đỏ 4 tuổi trở l&ecirc;n\r\n\r\n&ndash; Thời kỳ kinh doanh từ năm thứ 4 trở đi: Trong thời kỳ cho quả, lượng ph&acirc;n b&oacute;n được thiết lập dựa tr&ecirc;n năng suất của vụ trước. C&oacute; thể tham khảo</pre>\r\n\r\n<pre>\r\n	\r\n		Thời vụ b&oacute;n: To&agrave;n bộ lượng ph&acirc;n sẽ được chia l&agrave;m 3 lần b&oacute;n trong năm.\r\n\r\nLần 1: B&oacute;n th&uacute;c hoa v&agrave;o th&aacute;ng 2: 40% đạm ur&ecirc; + 30%  kali\r\n\r\nLần 2: B&oacute;n th&uacute;c quả v&agrave;o th&aacute;ng 4 &ndash; 5: 20%  đạm ur&ecirc; + 30% kali\r\n\r\nLần 3: B&oacute;n sau thu hoạch v&agrave;o th&aacute;ng 11 &ndash; 12: 100% ph&acirc;n hữu cơ  + 100% ph&acirc;n l&acirc;n + 40%  đạm , 40%  kali.\r\n\r\nPh&ograve;ng trừ s&acirc;u bệnh:\r\n\r\n&ndash; Thường xuy&ecirc;n kiểm tra vườn c&acirc;y, ph&aacute;t hiện s&acirc;u bệnh kịp thời\r\n\r\n&ndash; X&eacute;n tỉa c&agrave;nh l&agrave; bị s&acirc;u bệnh, sử dụng thuộc bảo vệ thực vật sinh học, thuốc h&oacute;a học &iacute;t độc  để ti&ecirc;u diệu Bọ x&iacute;t, nhện ch&iacute;ch h&uacute;t, rầy, rệp phun&hellip;\r\n\r\nBạn c&oacute; thể li&ecirc;n hệ với ch&uacute;ng t&ocirc;i qua 01644952648  gặp Mr Linh để đặt mua c&acirc;y bưởi đỏ giống được trồng tại tr&ecirc;n đất đỏ.\r\n\r\n<span style=\"color:blue; font-size:25px\">Địa chỉ: T&acirc;n Lai- Đ&ocirc;ng Lai- T&acirc;n Lạc- H&ograve;a B&igrave;nh</span></pre>\r\n', 16, 1, 1, 1, '2017-05-19 16:29:29', '2017-05-19 16:48:26', 'admin', '2017-05-19 16:27:21', 2),
